export default function ListeProfils(props) {
  return (
    <div>
      {props.profils && props.profils.map((profil) => (
        <div className="profil" key={profil.login}>
          <h3>{profil.login}</h3>
          <p>{profil.bio}</p>
        </div>
      ))}
    </div>
  );
}
